// ==UserScript==
// @name         Priem Attack Alarm
// @version      1.7.0
// @description  Custom and better attack alarm.
// @author       miro
// @include      https://*.grepolis.com/game/*
// @grant        none
// @namespace https://greasyfork.org/users/984383
// @downloadURL https://update.greasyfork.org/scripts/477899/Priem%20Attack%20Alarm.user.js
// @updateURL https://update.greasyfork.org/scripts/477899/Priem%20Attack%20Alarm.meta.js
// ==/UserScript==



(function() {
    'use strict';

        
    var knownAttacks = [];



    var PriemAudio = new Audio("data:audio/mpeg;base64,");
    PriemAudio.loop = true;

    function getActiveConquests() {
        var conquests = [];

        MM.getCollections().Takeover[0].models.forEach((element) => {
            var attrs = element.attributes;
            if(!attrs.command.is_returning && attrs.command.own_command) {
                conquests.push(attrs.destination_town.id);
            }
        });
        
        return conquests;
    }


    function getIncomingAttacks() {
        var incomings = [];

        MM.getCollections().Attack[0].models.forEach((element) => {
            var attrs = element.attributes;
            if(attrs.incoming > 0) {
                incomings.push({
                    incoming: attrs.incoming, 
                    town_id: attrs.town_id
                });
            }
        });

        return incomings;
    }

    function checkIncomingAttacksConquests() {
        var incomingAttacks = getIncomingAttacks();
        var activeConquests = getActiveConquests();

        

        incomingAttacks.forEach((element) => {
            if(activeConquests.includes(element.town_id)) {
                if(knownAttacks.hasOwnProperty(element.town_id) && knownAttacks[element.town_id] >= element.incoming){
                    if(knownAttacks[element.town_id] > element.incoming) {
                        knownAttacks[element.town_id] = element.incoming;
                    }
                    return;
                }
                startAlarm();
            }	
        });
    }

    function checkIncomingAttacksPlayer() {
        var incomingAttacks = getIncomingAttacks();
        var playerTowns = getPlayerTowns();
            
        incomingAttacks.forEach((element) => {
            if(playerTowns.includes(element.town_id)){
                if(knownAttacks.hasOwnProperty(element.town_id) && knownAttacks[element.town_id] >= element.incoming){
                    if(knownAttacks[element.town_id] > element.incoming) {
                        knownAttacks[element.town_id] = element.incoming;
                    }
                    return;
                }
                startAlarm();
            }
        });
    }

    function startAlarm() {
        if(PriemAudio.paused) {
            PriemAudio.loop = true;
            PriemAudio.play();
        }
    }

    function stopAlarm() {
        console.log("Stop alarm");
        PriemAudio.loop = false;
        PriemAudio.pause();
        PriemAudio.currentTime = 0;
        updateKnownAttacks();
    }

    function updateKnownAttacks() {
        knownAttacks = {};
        getIncomingAttacks().forEach((element) => {
            knownAttacks[element.town_id] = element.incoming;
        });
    }

    function getPlayerTowns() {
        return MM.getModels().TownIdList[Game.player_id].attributes.town_ids;
    }

    setInterval(checkIncomingAttacksConquests, 100);
    setInterval(checkIncomingAttacksPlayer, 50);



    function addPriemCss() {
        var cssId = 'priem-css-file';
        if (!document.getElementById(cssId)) {
            var head = document.getElementsByTagName('head')[0];
            var style = document.createElement('style');
            style.id = cssId;
            var data = ".priem-alarm-menu { position: absolute; z-index: 865; left: 120px; bottom: 10px; } #priem-alarm-button { background:  url('data:image/png;base64,') no-repeat; background-size: 50px; width: 50px; height: 50px; cursor: pointer; }";
            style.innerHTML = data;
            head.appendChild(style);
        }


    }


    addPriemCss();

    $('.nui_main_menu')[0].insertAdjacentHTML('afterend', '<div class="priem-alarm-menu">     <div id="priem-alarm-button">     </div> </div>');

    document.getElementById('priem-alarm-button').onclick = function() {
        stopAlarm();
    }


})();
